import { Link } from 'react-router-dom';


const ProductsPage = () => {
    return (
        <>
            <h1>Products Page</h1>
            <ul>
                <li><Link>Product1</Link></li>
                <li><Link>Product2</Link></li>
            </ul>
        </>
    )
};

export default ProductsPage;
